" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 616px\">",
"   <div class=\"ttl\">",
"    Dermoscopic structures seen in melanocytic lesions and their histopathological correlations",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 596px; height: 624px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    List continued in figure \"Dermoscopic structures 2\". Melanocytic neoplasms: Dermoscopic structures and histopathologic correlation.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reference:",
"     <br/>",
"     <ol>",
"      <li>",
"       Jaimes N, Braun RP, Stolz W, et al. White globules correlate with balloon cell nevi nests. J Am Acad Dermatol 2011; 65:e119.",
"      </li>",
"     </ol>",
"     <br/>",
"     Reproduced with permission from: Drs. Ashfaq Marghoob and Natalia Jaimes.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 616px\">",
"   <div class=\"ttl\">",
"    Dermoscopic structures seen in melanocytic lesions and their histopathologic correlations, continued",
"    <sup>",
"     [1-3]",
"    </sup>",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 596px; height: 567px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This is a continuation of figure \"Dermoscopic structures 1\". Melanocytic neoplasms: Dermoscopic structures and histopathologic correlation.",
"    <div class=\"footnotes\">",
"     * Shiny white structures can also be seen in non-melanocytic lesions. Chrysalis/crystalline structures (also known as white shiny streaks) in melanocytic lesions are most common in melanoma and Spitz nevi",
"     <sup>",
"      [8]",
"     </sup>",
"     . Both chrysalis/crystalline structures and white shiny areas are common in dermatofibromas and basal cell carcinomas",
"     <sup>",
"      [9,10]",
"     </sup>",
"     . Rosettes are more common in actinic keratosis and squamous cell carcinomas",
"     <sup>",
"      [5]",
"     </sup>",
"     .",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <br>",
"      <ol>",
"       <li>",
"        Pehamberger H, Steiner A, Wolff K. In vivo epiluminescence microscopy of pigmented skin lesions. I. Pattern analysis of pigmented skin lesions. J Am Acad Dermatol 1987; 17:571.",
"       </li>",
"       <li>",
"        Argenziano G, Soyer HP, Chimenti S, et al. Dermoscopy of pigmented skin lesions: results of a consensus meeting via the Internet. J Am Acad Dermatol 2003; 48:679.",
"       </li>",
"       <li>",
"        Braun RP, Rabinovitz HS, Oliviero M, et al. Dermoscopy of pigmented skin lesions. J Am Acad Dermatol 2005; 52:109.",
"       </li>",
"       <li>",
"        Zalaudek I, Argenziano G, Ferrara G, et al. Clinically equivocal melanocytic skin lesions with features of regression: a dermoscopic-pathological study. Br J Dermatol 2004; 150:64.",
"       </li>",
"       <li>",
"        Liebman TN, Rabinovitz HS, Balagula Y, et al. White Shiny Structures in Melanoma and BCC. Arch Dermatol 2012; 148:146",
"       </li>",
"       <li>",
"        Cuellar F, Vilalta A, Puig S, et al. New dermoscopic pattern in actinic keratosis and related conditions. Arch Dermatol 2009; 145:732.",
"       </li>",
"       <li>",
"        Balagula Y, Braun RP, Rabinovitz HS, et al. The significance of crystalline/chrysalis structures in the diagnosis of melanocytic and nonmelanocytic lesions. J Am Acad Dermatol 2011. Epub ahead of print.",
"       </li>",
"       <li>",
"        Di Stefani A, Campbell TM, Malvehy J, et al. Shiny white streaks: An additional dermoscopic finding in melanomas viewed using contact polarised dermoscopy. Australas J Dermatol 2010; 51:295.",
"       </li>",
"       <li>",
"        Marghoob AA, Cowell L, Kopf AW, Scope A. Observation of chrysalis structures with polarized dermoscopy. Arch Dermatol 2009; 145:618.",
"       </li>",
"       <li>",
"        Altamura D, Menzies SW, Argenziano G, et al. Dermatoscopy of basal cell carcinoma: morphologic variability of global and local features and accuracy of diagnosis. J Am Acad Dermatol 2010; 62:67.",
"       </li>",
"      </ol>",
