var title_f0_1_20="Mgmt interleukin 2 toxicity I";
var content_f0_1_20=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F67823%7EONC%2F80320&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F67823%7EONC%2F80320&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Management of IL-2 toxicity",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Hypotension",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       1. Minimal fluid resuscitation to avoid fluid overload.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       2. Normally systolic blood pressure (SBP) is 20-30 mmHg lower than baseline but patient is asymptomatic. In younger patients, may tolerate SBP 80 mmHg; in older patients, may tolerate SBP 85-90mmHg, depending on baseline. If baseline is higher, may maintain SBP at 100 mmHg.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       3. Although saline may be utilized initially, it should be used judiciously to avoid fluid overload and extensive capillary leak.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       4. Colloid administration may be necessary if SBP is lower, for symptomatic hypotension, or if urine output declines.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       5. Pressors, either dopamine, 1-6 microg/kg/min (if not tachycardic) or phenylephrine, 0.1-2.0 microg/kg/min, maybe used to stabilize blood pressure.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       6. Patients routinely gain 4.5 kg (10 lbs) in water weight.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Cardiac arrhythmia",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       1. Sinus tachycardia is common and may reflect maximal toxicity between doses, or a reaction to hypotension or dopamine administration. Extension of time between doses may control this.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       2. Supraventricular tachycardia may occur with therapy and may require treatment depending on rate. Therapy can be continued once this is controlled, by extending time between doses. If this occurs near the end of the course of treatment, treatment should probably be discontinued.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       3. IL-2 doses should be withheld for atrial fibrillation, but may be resumed when conversion to sinus rhythm is accomplished and the patient is hemodynamically stable.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       4. If significant (ventricular) arrhythmias occur during treatment, IL-2 should be held and an evaluation for cardiac damage must be undertaken, for ischemia or infarction.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       5. Although isolated premature ventricular contractions may not signal discontinuation of IL-2, if they increase in frequency or become sustained, IL-2 therapy should be stopped.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Metabolic acidosis",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       1. Metabolic acidosis may occur with reductions in serum bicarbonate.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       2. Sodium bicarbonate should be utilized to maintain serum HCO3 above 18 meq/L.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       3. If bicarbonate is persistently low, IL-2 should be held.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Fevers/chills",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       1. These can be prevented to some extent by premedication with acetaminophen, 650 mg orally every 4 hr, and indomethacin, 25 mg orally every 6 hr throughout IL-2 administration. H-2 blockers should be administered to protect the gastric mucosa.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       2. Patients who develop dose-related significant shaking chills, usually 30-90 min following the dose, should receive intravenous meperidol (pethidine) 25-50 mg to stop them. They may then need prochlorperazine for nausea.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Nausea/vomiting",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       1. Although not occurring in all patients, we routinely provide premedication daily with 5HT3 antagonists (eg, ondansetron), as well as prochlorperazine for dose-relate nausea. Dexamethasone is not routinely given.",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Dutcher J, Atkins MB, Margolin K, et al for the Cytokine Working Group. Kidney Cancer: The Cytokine Working Group Experience (1986-2001), part II. Management of IL-2 toxicity and studies with other cytokines. Med Oncol 2001; 18:209. Copyright &copy; 2001 Humana Press.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Management of IL-2 toxicity, continued",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Dyspnea",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       1. Rare. May reflect fluid overload. Check oxygen saturation and withhold IL-2 until oxygen saturation is above 95 percent. Diuretics as clinically indicated.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       2. Clarify that serum bicarbonate is greater than 18 meq/L.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Peripheral edema",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       1. Usually not clinically significant and will reverse once IL-2 is discontinued.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       2. Diuretics may be indicated upon discharge if weight is greatly increased or peripheral edema is clinically detectable (ie, rings too tight, pitting edema, unable to fully close hand or put on usual shoes).",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Oliguria, rising creatinine",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       1. Increase in serum creatinine is usually not clinically significant and will reverse once IL-2 is discontinued.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       2. However, oliguria, if significant fluid overload, may provide an indication to hold or delay IL-2 until urine output is improved.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       3. Some centers set an upper limit of creatinine, at which point IL-2 is discontinued.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Transminase elevations",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       1. Usually not clinically significant and will reverse once IL-2 is discontinued.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Neurotoxicity",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       1. This can be a significant toxicity.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       2. IL-2 should be held for persistent confusion, disorientation, hallucinations, progressive agitation, or somnolence unrelated to concomitant medication.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       3. If not grade 4 neurotoxicity, IL-2 can be resumed with resolution of symptoms.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       4. If symptoms recur, IL-2 should be stopped.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Skin rash, pruritus",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       1. Rash is common during treatment and is treated symptomatically with emollients and antihistamines.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       2. For pruitis that does not respond to antihistamines such as diphenhydramine or hydroxyzine, gabapentin may be helpful, as it affects peripheral nerve fibers.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       3. Pruritis may persist long after IL-2 treatment is discontinued.",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Dutcher J, Atkins MB, Margolin K, et al for the Cytokine Working Group. Kidney Cancer: The Cytokine Working Group Experience (1986-2001), part II. Management of IL-2 toxicity and studies with other cytokines. Med Oncol 2001; 18:209. Copyright &copy; 2001 Humana Press.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
