"      Patient information: Campylobacter infection (The Basics)",
"     </a>",
"    </p>",
"    <p class=\"headingAnchor2\" id=\"H12026899\">",
"     <span class=\"h3\">",
"      Beyond the Basics",
"     </span>",
"     &nbsp;&mdash;&nbsp;Beyond the Basics patient education pieces are longer, more sophisticated, and more detailed. These articles are best for patients who want in-depth information and are comfortable with some medical jargon.",
"    </p>",
"    <p>",
"     <a class=\"medical medical_patient\" href=\"UTD.htm?35/29/36308?source=see_link\">",
"      Patient information: Acute diarrhea in adults (Beyond the Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_patient\" href=\"UTD.htm?21/54/22371?source=see_link\">",
"      Patient information: Nausea and vomiting in infants and children (Beyond the Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_patient\" href=\"UTD.htm?10/11/10418?source=see_link\">",
"      Patient information: Bloody stools in children (Beyond the Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_patient\" href=\"UTD.htm?28/0/28673?source=see_link\">",
