"     </a>",
"     <br/>",
"     <a class=\"medical medical_patient\" href=\"UTD.htm?28/30/29156?source=see_link\">",
"      Patient information: Food poisoning (food-borne illness) (Beyond the Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_patient\" href=\"UTD.htm?18/52/19267?source=see_link\">",
"      Patient information: Antibiotic-associated diarrhea caused by Clostridium difficile (Beyond the Basics)",
"     </a>",
"     <br/>",
"    </p>",
"    <p class=\"headingAnchor2\" id=\"H12026919\">",
"     <span class=\"h2\">",
"      Professional level information",
"     </span>",
"     &nbsp;&mdash;&nbsp;Professional level articles are designed to keep doctors and other health professionals up-to-date on the latest medical findings. These articles are thorough, long, and complex, and they contain multiple references to the research on which they are based. Professional level articles are best for people who are comfortable with a lot of medical terminology and who want to read the same materials their doctors are reading.",
"    </p>",
"    <p>",
"     <a class=\"medical medical_review\" href=\"UTD.htm?34/43/35511?source=see_link\">",
"      Approach to the diagnosis of chronic diarrhea in children in developed countries",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_review\" href=\"UTD.htm?13/57/14232?source=see_link\">",
"      Clinical manifestations, diagnosis and treatment of enterohemorrhagic Escherichia coli (EHEC) infection",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_review\" href=\"UTD.htm?25/48/26376?source=see_link\">",
